import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Nav, Navbar } from 'react-bootstrap';
import '../App.css';

const Header = () => {
    return (
        <header>
            <Navbar className="header_style" collapseOnSelect variant="dark" fixed="top" expand="md">
                <Navbar.Brand className="header_title">NUESS</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="#">ホーム</Nav.Link>
                        <Nav.Link href="#">使い方</Nav.Link>
                        <Nav.Link href="https://www.nara-edu.ac.jp/">奈良教育大学HP</Nav.Link>
                        <Nav.Link href="https://www.nara-edu.ac.jp/ADMIN/KYOUMU/syllabus/2021/KmkkbnIchiran_0_0.html">奈良教育大学時間割表</Nav.Link>
                        <Nav.Link href="#">更新履歴</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        </header>
    );
};

export default Header;
